import React from "react";

function Image({ text, imageUrl }) {
  return (
    <div className="example-carousel-item">
      <img src={imageUrl} alt={text} />
      <div className="carousel-text">
        <h3>{text}</h3>
      </div>
    </div>
  );
}

export default Image;
